import React from 'react';
import { NavLink } from 'react-router-dom';

function Dinamic(){
    return(
       <nav>
        <ul>
            {routes.map(route => (
                <li>
                    <NavLink
                        to={route.to}
                  >
                    
                  </NavLink>
                </li>
            ))}
        </ul>
       </nav>
    )
}

const routes = [];

routes.push({
    to:'/',
    text:'home'
})
routes.push({
    to:'/blog',
    text:'blog'
})
routes.push({
    to:'/profile',
    text:'profile'
})

export {Dinamic}
